 @an.ky01  Vdd,mas discordo na parte do flamengo,pq msm sem precisar da ajuda da arbitragem talvez estaria no máximo na quarta colocação.
 Até porque o time que tem o flamengo é outro nível,principalmente destacando que se tivesse o Dorival antes do campeonato pode apostar que seria diferente e o flamengo não começaria mal o brasileiro e poderia tá mais perto do palmeiras. Até porque não lembro de nenhum lance polêmico quando o Flamengo tinha o Paulo souza no comando.
 E esse time tbm não chegou na final da Copa do brasil atoa.

 @torcedor2737  mesmo sendo corintiano, eu acho que o flamengo mete no mínimo 3 gols.
A zaga do furacão é muito lenta.
A algumas semanas atrás ganhamos de 2x1 com nossos reservas, que todos sabem que são horríveis, que se salvam são uns 3.

 @hakillseml6279  o furacão tava com dois reservas apenas, nem dá pra chamar de "misto".
Mas vamos ver, todo time cresce muito em final.
Espero que seja um bom jogo e que não tenha erro na arbitragem.

 @Rodrigo-ix7vq   Se vcs fizessem aquele primeiro gol ( de pênalti) com certeza o Flamengo iria aumentar a pressão em busca de resultado, ainda mais o Flamengo completo, a gnt ia ganhar de qlqr forma mano.
Queria muito que o pênalti fosse validado pelo var, só pra tirar essa diferença. 
Final de campeonato Flamengo ia perder nunca pro santos no maraca

 @ale_dxd3875  concordo que o Flamengo não precisava disso para ganhar, assim como você deve concordar comigo que os clubes não devem ser penalizados por erros da arbitragem e quando esses acontecem a culpa é da arbitragem e não do clube rival.
Ademais, discordo que o Flamengo tenha tido algum pênalti, vi um comentarista só falar de reclamação de pênalti no Cebolinha e ele fala que não foi pênalti de maneira alguma.
A questão aqui não é o Flamengo, mas os sucessivos erros de arbitragem que penalizam o Santos a anos, especialmente nesse ano. Antes do Flamengo, contra o Corinthians o Santos teve um jogador expulso por pisar no chão.

